import "./App.css";

function App() {
  return (
    <div className="App">
      <div id="background">
        <img src={require("./images/background.png")} alt="" id="bg-top" />
        <img src={require("./images/background.png")} alt="" id="bg" />
        <div className="container">
          <div className="row">
            <div className="col text-center">
              <h1 className="display-3">Welcome to AI Jokes</h1>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
